const e=`{% block sw_cms_el_form_newsletter %} <div class="sw-cms-el-form-newsletter"> <h3 v-if="formSettings.title.value.length > 0" class="sw-cms-el-form-headline" > {{ formSettings.title.value }} </h3> <mt-select :label="$tc('sw-cms.elements.form.element.label.action')" :model-value="''" :options="[{ value: '', label: $tc('sw-cms.elements.form.element.label.subscribeToNewsletter') }]" /> <mt-text-field :label="$tc('sw-cms.elements.form.element.label.email')" :model-value="$tc('sw-cms.elements.form.element.placeholder.email')" /> <div class="sw-cms-el-form-contact-form-group three-items"> <mt-select :label="$tc('sw-cms.elements.form.element.newsletter.label.salutation')" :options="[{ value: '', label: $tc('sw-cms.elements.form.element.label.salutationUndisclosed') }]" /> <mt-text-field :label="$tc('sw-cms.elements.form.element.newsletter.label.firstName')" :model-value="$tc('sw-cms.elements.form.element.placeholder.firstName')" /> <mt-text-field :label="$tc('sw-cms.elements.form.element.newsletter.label.lastName')" :model-value="$tc('sw-cms.elements.form.element.placeholder.lastName')" /> </div> <h4>{{ $t('sw-cms.elements.form.element.label.privacy') }}</h4> <p class="sw-cms-el-form-newsletter__privacy" v-html="$t('sw-cms.general.privacyNotice')" ></p> <p class="sw-cms-el-form-newsletter__note"> {{ $t('sw-cms.elements.form.element.helpText.requiredFields') }} </p> <div class="sw-cms-el-form__action"> {{ $t('global.default.submit') }} </div> </div> {% endblock %}`,l={template:e,props:["formSettings"]};export{l as default};
